function uniq(array) {
  var uniques = {};
  var results = [];

  for (var i = 0, j = array.length; i < j; i += 1) {
    if (uniques.hasOwnProperty(array[i])) {
      continue;
    }
    results.push(array[i]);
    uniques[array[i]] = 1;
  }

  return results;
}
